import { Menu, Button } from 'antd';
import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
  GlobalOutlined,
  BarsOutlined,
  QrcodeOutlined
} from '@ant-design/icons';
import { useState, useEffect } from 'react';
const { SubMenu } = Menu;

const axios = require('axios')

const content = {
  marginTop: '100px',
}

export default function Home() {
  // axios.get('http://numbersapi.com/42')
  // .then(function (response) {
